('2320','24','5150','Luis',Null,'5 Rohbauetagen am Paseo Maritimo zu verkaufen','32763','Das hier angebotene Gebäude liegt direkt am Paseo Maritimo mit Blick auf den Hafen von Palma de Mallorca. 2 Ladenlokale im Erdgeschoss des Gebäudes sind schon verkauft. Die darüber liegende 5 Etagen befinden sich im Rohbau und werden zum Kauf angeboten. Die ca 1.700m² konstruierte Fläche können zu Apartments oder zu einem Aparthotel ausgebaut werden. Die Dachterrasse ist nicht nutzbar. Sie dient als Terrasse einer der hinter dem Gebäude liegenden Apartments.','32764','3600000','106','2015-04-08 14:33:03','106','2015-04-08 14:33:24',Null,'2373','105','1118',1,'1','0',Null,Null,Null,'32765',Null,'0','0','0',Null,'2015-04-08 14:35:25',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32766',Null,'32767',Null,'32768',Null,'32769','620432750','32770','0',0,'0');
